class Solution(object):

    def findMaxForm(self, strs, m, n):
        """
        :type strs: List[str]
        :type m: int
        :type n: int
        :rtype: int
        """
        dp = [[0 for i in range(n+1)] for j in range(m+1)]   # dp[i][j]代表i个0和j个1在数组中最多能拼出的字符串个数
        for str in strs:
            a, b = str.count('0'), str.count('1')
            for i in range(m, a-1, -1):
                for j in range(n, b-1, -1):
                    dp[i][j] = max(dp[i][j], 1+dp[i-a][j-b])
        print(dp)
        return dp[m][n]


